import React from 'react'
import HomeNav from '../components/home-nav'

var stylingObject = {
    container: {
        background: "red",
        width: "100%",
        height: "100%"
    }
}

function Home() {
    return (
        <div style = {stylingObject.container}>
            <HomeNav></HomeNav>
        </div>
    )
}

export default Home
